  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report cover activities
  during January to April 1944 for Lake Ardoch, Kellys Slough, Little Goose, Pioneer
  Lake, Wood Lake, Silver Lake, Lac Aux Mortes (Devil's Lake), Buffalo Lake, Johnson's
  Lake, Sibley Lake, Prairie Lake, Lambs Lake, Billings Lake, Rose Lake, Pleasant
  Lake. Water and wildlife are discussed. Followed by refuge development and maintenance,
  public relations, violations and field investigations or applied research. Photographs
  and NR forms are included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
